function preload() {
    game.time.advancedTiming = true;
    game.load.image('low_infection', 'low_infection.png');
    game.load.image('circle_infection', 'circle_infection.png');
    game.load.image('noise', 'noise.png');

}



let options = initOptions({
    cachedPointsList: ["boolean", true],
    debugPointsList: ["boolean", false],
    spawnDelay: ["int", 1000],
    showGrid: ["boolean", false],
    useShaders: ["boolean", true]
});

/*

 - grid
 - generate infection (by timer or by click - as before)
 - on each update
   + check just added cells. check circles of those cells
     + if circle can grow and not grown and cooldown timer allows - grow
   + check just removed cells
     + if here is circle grown which cannot be there - blow it up (erase, draw animation of blowing - from Tolik)
     - animation from Tolik
   - texture
   - timer
   - inc lifetime
     - ?? how to make it darker in time? via shaders (so texture shall have info about time), or... or redraw time to time

 */

const SIZE = 1024;
const PIX = 18;


function createGrid(gridSize, ctor = (gx, gy) => undefined ) {
    let grid = [];
    for (let gx = 0; gx < gridSize; gx++) {
        let col = [];
        for (let gy = 0; gy < gridSize; gy++) {
            col.push(createGrid(gx, gy));
        }
        grid.push(col);
    }
}

var bitmapLow, bitmapCircles, spriteLow, spriteCircles;
var grid, auto, recolorAll;

function create() {
    game.rnd.sow([1]);
    grid = new Grid(SIZE/PIX, SIZE/PIX);
    game.stage.backgroundColor = '#cccccc';


    let debugBitmap = drawDebugGrid();

    bitmapLow = game.add.bitmapData(SIZE, SIZE);
    bitmapCircles = game.add.bitmapData(SIZE, SIZE);

    let points = POINTS;
    if (!options.cachedPointsList) {
        points = preparePoints(1024, PIX);
        console.log(JSON.stringify(points));
    }
    if (options.debugPointsList) debugPoints(debugBitmap, points);

    spriteLow = game.add.sprite(0, 0, bitmapLow);
    //spriteLow.alpha = 0.2;
    spriteCircles = game.add.sprite(0, 0, bitmapCircles);
    controller = createInfectionController(points, bitmapCircles, 1024/PIX);
    grower = createGrower(grid, bitmapLow);
    auto = createAutoGrower(grid, options.spawnDelay);

    //bitmapCircles.filters = [new Breathing(game)];

    let noiseSprite = game.add.sprite(-1000,-1000, 'noise');

    let infShader = new LowInfection(game);
    let infTextureSprite = game.add.sprite(-100,-100, 'low_infection');
    infShader.uniforms.iChannel0.value = infTextureSprite.texture;
    infShader.uniforms.iChannel1.value = noiseSprite.texture;
    infShader.uniforms.iChannel1.textureData = {nearest: true};
    infShader.uniforms.textureSize.value = {x: infTextureSprite.width, y: infTextureSprite.height};
    infShader.uniforms.resolution.value = {x: game.world.width, y: game.world.height};

    if (options.useShaders) spriteLow.filters = [infShader];

    let breShader = new Breathing(game);
    let breTextureSprite = game.add.sprite(-100,-100, 'circle_infection');
    breShader.uniforms.iChannel0.value = breTextureSprite.texture;
    breShader.uniforms.iChannel0.textureData = {nearest: true};
    breShader.uniforms.iChannel1.value = noiseSprite.texture;
    breShader.uniforms.iChannel1.textureData = {nearest: true};
    breShader.uniforms.textureSize.value = {x: breTextureSprite.width, y: breTextureSprite.height};
    breShader.uniforms.resolution.value = {x: game.world.width, y: game.world.height};

    if (options.useShaders) spriteCircles.filters = [breShader];

    grid.set(8,1, {i:true});
    grid.set(9,1, {i:true});

    buttons = {
        Z: game.input.keyboard.addKey(Phaser.Keyboard.Z),
        X: game.input.keyboard.addKey(Phaser.Keyboard.X),
        C: game.input.keyboard.addKey(Phaser.Keyboard.C)
    };

}

var controller, grower, buttons;

function drawDebugGrid() {
    let debugBm = game.add.bitmapData(SIZE, SIZE);
    let debugSprite = game.add.sprite(0, 0, debugBm);
    debugSprite.alpha = 0.3;
    debugBm.ctx.strokeStyle = 'gray';
    if (options.showGrid) {
        for (let gx = 0; gx < SIZE; gx += PIX) {
            debugBm.ctx.moveTo(gx, 0);
            debugBm.ctx.lineTo(gx, SIZE);
            debugBm.ctx.moveTo(0, gx);
            debugBm.ctx.lineTo(SIZE, gx)
        }
        debugBm.ctx.stroke();
    }
    return debugBm;
}

var lastUpdated;

function update() {
    let gx = (game.input.activePointer.x / PIX) | 0, gy = (game.input.activePointer.y / PIX) | 0;
    if (buttons.Z.justDown) {
        grid.set(gx, gy, {i: true});
    }
    if (buttons.X.justDown) {
        grid.set(gx, gy, undefined);
    }

    let updated = grower.update();
    if (updated) {
        bitmapLow._updated = false;
        lastUpdated = updated;
    } else {
        let recolored = recolorAll(bitmapLow, grid);
        lastUpdated = recolored + ' recolored';
    }

    for (let {gx,gy} of grid.grown) {
        let points = controller.findPointsByGrid(gx, gy).filter(p => {
            if (p.state == 'growing') return false;
            return p.cells.every(({gx,gy}) => grid.get(gx,gy));
        });
        points.forEach(p => controller.addInfectionAt(p));
    }
    for (let {gx, gy} of grid.removed) {
        let points = controller.findPointsByGrid(gx, gy).filter(p => {
            if (p.state != 'growing') return false;
            return !p.cells.every(({gx,gy}) => grid.get(gx,gy));
        });
        points.forEach(p => controller.removeInfectionAt(p));
    }

    controller.update();
    grid.clear();

    if (spriteLow.filters) spriteLow.filters.forEach(f => f.update());
    if (spriteCircles.filters) spriteCircles.filters.forEach(f => f.update());
}


let fpsEl = document.querySelector("#fps");
function debugRender1() {
    fpsEl.innerText = game.time.fps + ' upd: ' + lastUpdated ;
    //game.debug.text(game.time.fps, game.camera.width/2,25);
}

document.querySelector("#start").addEventListener("click", () => auto.start());
document.querySelector("#stop").addEventListener("click", () => auto.stop());


